import React from 'react'
import './UnitsList.css'

const UnitsList = (props) => {

  return (
  <tr>
    <td>{props.id}</td>
    <td>{props.name}</td>
    <td>{props.age}</td>
  </tr>
  );
};

export default UnitsList;
